                className="dashboard-wrapper"
                id="lending-page"
            >
                <div className="background-img">
                    <div className="lending-image">
                        <div class="card">
                            <h1>Split Wise</h1>
                            <h3></h3>
                        </div>
                    </div>
                </div>

                {/* <div className="button-wrapper">
                    <button
                        className="start-button"
                        onClick={() => {
                            navigate("/home");
                        }}
                    >
                        WelCome{" "}
                    </button>
                </div> */}
            </div>
        </>
    );
};

export default Lending;
